sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

  var response=JSON.parse(inputs.responseBody);

  outputs.ipaddress=response['ip'];
  outputs['city']=response['city'];
  outputs['country']=response.country;
  outputs.postal=response.postal;
  outputs.timezone=response.timezone;

  var location=response.loc.split(",");
  outputs.lattitude=location[0];
  outputs.longitude=location[1];

})(inputs, outputs);

